import './App.css';
import styled from 'styled-components';

 /*stylesheet*/
const Blog = styled.div`
display: flex;
justify-content: center;
align-items: center;
flex-direction: column;
`;
const Heading = styled.div`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;


function App() {

  return (
    <Blog>
      <Heading>
       <span>My Recent Posts</span>
       <h3>My Blog</h3>
      </Heading>
    </Blog>
  );
}

export default App;
